      .container {
        max-width: 400px;
        margin: 0 auto;
        margin-top: 3rem;
        text-align: center;
      }

      .img-container {
        margin: 0 auto;
        width: fit-content;
        text-align: center;
      }

      .image {
        max-width: 60px;
        object-fit: contain;
      }

      .msg {
        font-size: 2rem;
        margin: 0.5rem 0;
      }

      .pre-loader {
        position: fixed;
        left: 0;
        top: 0;
        width: 100%;
        height: 100%;
        background-color: #fff;
        display: flex;
        align-items: center;
        justify-content: center;
      }

      .spinner {
        width: 60px;
        height: 60px;
        border-radius: 50%;
        border: 4px solid #fafafa;
        animation: spin 1s linear infinite;
        border-bottom-color: red;
      }

      @keyframes spin {
        to {
          transform: rotate(360deg);
        }
      }
    </style>
